

<html>
<head>
<script type="text/javascript">

   function check() {
    var cat = document.FormMarque.ListeMarque.selectedIndex;
    //ajout liste d'index
    document.getElementById('Index').value += generMarque[1][cat];
    document.getElementById('Index').value += ";";
    //ajout du mot à la phrase
    document.getElementById('Phrase').value += generMarque[0][cat];
    document.getElementById('Phrase').value += ";";
    //Ajout du code arduino
    var textValue=document.getElementById('Arduino').value;
    if (textValue.indexOf(generMarque[1][cat])==-1)
    { 
      //On ajoute la chaine LPC que si elle n'est pas déjà dans le code !
      document.getElementById('Arduino').value += "//";
      document.getElementById('Arduino').value += generMarque[0][cat];
      document.getElementById('Arduino').value += "\n";
      document.getElementById('Arduino').value += "const uint8_t sp";
      document.getElementById('Arduino').value += generMarque[1][cat];
      document.getElementById('Arduino').value +=" [] PROGMEM ={";
      document.getElementById('Arduino').value += generMarque[2][cat];
      document.getElementById('Arduino').value +="};\n";
    }
    //alert(generMarque[1][cat]);
    }
    
    
    function Clear_all() {
    document.getElementById('Index').value = ""
    document.getElementById('Phrase').value = "";
    document.getElementById('Arduino').value = "";
    }  
    
     function Clear_phr() {
    document.getElementById('Index').value = ""
    document.getElementById('Phrase').value = "";
    }  


</script>
</head>
<body>
    <FORM name="FormMarque">
        Sélectionner le mot à ajouter à votre phrase :
            <select name="ListeMarque"  onChange="check();">
            </select></br><br/>
            Votre phrase : <input id="Phrase" name="ch_texte" type="text" value="" size="140" readonly="true" /><br/><br/>
            Le code a recopier dans Blockly@rduino : <input id="Index" name="ch_texte" type="text" value="" size="100" readonly="true" /><br/><br/>
            Code Arduino : définition des chaines LPC<br/>
            <textarea id="Arduino" name="arduino"  rows="30" cols="170"></textarea><br/>
            <button onClick="Clear_all();">Effacer tout</button>
    </form>
